var dotooltips=function(){"use strict";if(document.querySelectorAll){var y=document.querySelectorAll("[data-tooltip]"),z=y.length;while(z-->0){var t=y[z].getAttribute("title");y[z].setAttribute("data-tooltip",t);y[z].removeAttribute("title");}}};dotooltips();
